import './App.css';


const App = () => {
  const users = [
    {name:"Pedro",age: 21},
    {name:"Jack",age: 21},
    {name:"Jessica",age: 21}
  ]
  const names = ['Pedro','Jake','Jessica','Mike','Michael']
  return (names.map((name,key)=>{
    return <h1 key={key} style={{color:"green"}}>{name},{key}</h1>
  }))

};


export default App
